import Square from "./Square";

function App() {
  return (
    <div>
      <div>
        <Square value="1" />
        <Square value="2" />
        <Square value="3" />
      </div>
      <div>
        <Square value="O" />
        <Square value="X" />
        <Square value="O" />
      </div>
      <div>
        <Square value="X" />
        <Square value="O" />
        <Square value="X" />
      </div>
    </div>
  );
}

export default App;
